Security

Cash Organizer team is attentive to safety, because we understand that security of personal and financial data is first and foremost. We save the entire banking security level: entering a login and a password, SMS-password, other security facilities of your bank. 

We do not use personal data. We work only with numbers, any user of Cash Organizer is anonymized for us. Cash Organizer does not keep or hold a username and a password on the server, they are left in your phone in an encrypted mode.

